import './profile.css';
import { Link, useParams } from 'react-router-dom';
import axios from 'axios';
import { useEffect } from 'react';

const Profile = (user) => {
    const {profileID} = useParams();

    if(profileID!=="") {
        const getNewUser = async() => {
            const res = await axios.get("https://localhost:8800/api/users/find/61c7f3ab1d1543928c0c0bb5")
            console.log(res);
        } 

        useEffect(()=>{})
    }
    // console.log("user is : " + user);
    // console.log(user.user.username)

    const queryString = "otherusers"+user.user.username;

    return(
        <>

        <img src={user.user.profilePic} alt="" />
        <h1>
            Your name: {user.user.username}
        </h1>
        <h1>
            Your email: {user.user.email}
        </h1>
        {/* <h1>
            Your password: {user.user.password}
        </h1> */}

        {user.user.isAdmin && <h1> You are an admin</h1>}
        {!user.user.isAdmin && <h1> You are not an admin</h1>}

<Link to={`/otherusers/${user.user.username}`}>

        <h1>
            view other users
        </h1>
</Link>
        </>
    );
}

export default Profile;
